import React from "react";
import styled from "styled-components";
import TodoItem from "./TodoItem";

const StyleTodo = styled.div`
    border: 1px solid red;
    width: 800px;
    height: 1000px;
    margin: auto;
    margin-top: 150px;
    display: flex;
`;

const AllTodo = styled.div`
    margin: auto;
    margin-top: 50px;
    border: 1px solid red;
`;

const Form = styled.form``;

const Input = styled.input`
    width: 300px;
    height: 50px;
`;

const Todo = () => {
    return (
        <StyleTodo>
            <AllTodo>
                <Form>
                    <Input></Input>
                    <button>Enter</button>
                </Form>
                <div>
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                </div>
            </AllTodo>
        </StyleTodo>
    );
};

export default Todo;
